import React from 'react';
const Agents = () => {
    return ( 
            
        <div className="container mt-5">
          <div className="row">
            <h1>Metro NZ Property Search</h1>

            <div className="col-8">
            <img src="/images/chris-smith.jpg" alt="" />
            <img src="/images/hayley-lewis.jpg" alt="" />
            </div>
            <div className="col-4">
            <img src="/images/get-in-touch.jpg" alt="" />
            </div>
             
        </div>
        </div>
     );
}
 
export default Agents;
